/**
 * JS for options panel functionality.
 * @see https://akshitsethi.com
 */

// Default options for Toastr
toastr.options = {
  "closeButton": false,
  "debug": false,
  "newestOnTop": true,
  "progressBar": false,
  "positionClass": "toast-bottom-right",
  "preventDuplicates": false,
  "onclick": null,
  "showDuration": "1000",
  "hideDuration": "1000",
  "timeOut": "5000",
  "extendedTimeOut": "1000",
  "showEasing": "swing",
  "hideEasing": "linear",
};

(function($) {
  'use strict';

  // When switching between support and about
  function hacks($tab) {
    // Submit button
    var $as_button = $('#' + ccsmm_admin_l10n.prefix + 'submit');

    // About
    if ($tab == '#about') {
      $as_button.hide();
    } else {
      $as_button.show();
    }

    // Support
    if ($tab == '#support') {
      $as_button.val(ccsmm_admin_l10n.support_text);
    } else {
      $as_button.val(ccsmm_admin_l10n.save_text);
    }
  }

  // Google fonts reload and change fonts
  function reloadFont($fontValue) {
    WebFont.load({
      google: {
        families: [$fontValue]
      }
    });
  }

  function changeFont($font) {
    var $fontValue = $font.val();

    // Make sure that only Google fonts go throught the font loader
    if (ccsmm_admin_l10n.default_fonts.indexOf($fontValue) === -1) {
      reloadFont($fontValue);
    }

    $font.parent().find('h3').css('font-family', $fontValue);
  }

  // Media upload function
  function getUploader($target) {
    var customUploader, parentTarget;

    // Specify the target's parent
    parentTarget = $target.parent().parent();

    // If the uploader object has already been created, reopen the dialog
    if (customUploader) {
      customUploader.open();
      return;
    }

    // Extend the wp.media object
    customUploader = wp.media({
      title: ccsmm_admin_l10n.select_text,
      button: {
        text: ccsmm_admin_l10n.select_text
      },
      multiple: false
    });

    // When a file is selected, grab the URL and set it as the text field's value
    customUploader.on('select', function () {
      var attachment = customUploader.state().get('selection').first().toJSON();

      parentTarget.find('input').val(attachment.url);
      parentTarget.find('.as-preview-area').html('<img src="' + attachment.url + '">');
      parentTarget.find('.as-upload-append').html('&nbsp;<a href="javascript:;" class="as-remove-image">' + ccsmm_admin_l10n.remove_text + '</a>');

      // Prompts to save changes
      parentTarget.find('input').addClass('changed-input');
    });

    customUploader.open();
  }

  // HTML and CSS editor
	function getEditor($editorID, $textareaID, $mode) {
		if ($('#' + $editorID).length > 0) {
      var editor, textarea;

      editor 	  = ace.edit($editorID, {
        mode: 'ace/mode/' + $mode,
        selectionStyle: 'text'
      });

      textarea 	= $('#' + $textareaID).hide();

			editor.session.setValue(textarea.val());
      editor.setTheme('ace/theme/xcode');

			editor.session.on('change', function () {
				textarea.val(editor.session.getValue());
			});

			editor.session.setUseWrapMode(true);
			editor.renderer.setShowPrintMargin(null);
			editor.session.setUseSoftTabs(null);
    }
  }


  // On DOM ready
  $(document).ready(function () {
    // IOS switches
    var elements = Array.prototype.slice.call(document.querySelectorAll('.as-form-ios'));

    elements.forEach(function(html) {
      var switchery = new Switchery(html);
    });


    // Google fonts
    $('.as-google-fonts').each(function () {
			var $font = $(this);
			changeFont($font);
		});

		$(document).on('change', '.as-google-fonts', function () {
			var $font = $(this);
			changeFont($font);
    });


    // Sorting elements
    var el = document.getElementById( 'arrange-items' );
    var sortable = Sortable.create( el, {
      animation: 150,
      dataIdAttr: 'data-id',
      store: {
        get: function (sortable) {
            var order = localStorage.getItem(sortable.options.group);
            return order ? order.split('|') : [];
        },
        set: function( sortable ) {
          var order = sortable.toArray();
          $( '#' + ccsmm_admin_l10n.prefix + 'arrange' ).val( order );
        }
      }
    } );


    // Editor
    getEditor(ccsmm_admin_l10n.prefix + 'html_editor', ccsmm_admin_l10n.prefix + 'html', 'html');
		getEditor(ccsmm_admin_l10n.prefix + 'css_editor', ccsmm_admin_l10n.prefix + 'css', 'css');


    // Sticky header
    if ($(window).width() <= 600) {
      $('.as-header').stick_in_parent({bottoming: false, offset_top: 0});
    } else if ($(window).width() > 600 && $(window).width() < 783) {
      $('.as-header').stick_in_parent({bottoming: false, offset_top: 46});
    } else {
      $('.as-header').stick_in_parent({bottoming: false, offset_top: 32});
    }


    // Media uploader
    $(document).on('click', '.as-upload', function (e) {
      e.preventDefault();
      getUploader($(this));
    });

    // Removing photo from the canvas and emptying the text field
    $(document).on('click', '.as-remove-image', function (e) {
      e.preventDefault();

      // Specify the target's parent
      var parentTarget = $(this).parent().parent().parent();

      parentTarget.find('input').val('');
      parentTarget.find('.as-preview-area').html(ccsmm_admin_l10n.upload_text);
      $(this).hide();

      // Prompts to save changes
      parentTarget.find('input').addClass('changed-input');
    });


    // Submission
    $(document).on('click', '#' + ccsmm_admin_l10n.prefix + 'submit', function (e) {
      e.preventDefault();

      // Main form identifier
      var formID = $('#' + ccsmm_admin_l10n.prefix + 'form');

      // Form data
      var formData 	= new FormData(formID[0]);

      // Append action
      formData.append('action', ccsmm_admin_l10n.prefix + 'options');
      formData.append('_nonce', ccsmm_admin_l10n.nonce);

      // AJAX
      $.ajax( {
        type: 'POST',
        url: ajaxurl,
        data: formData,
        processData: false,
        contentType: false,
        beforeSend: function() {
          formID.block({
            message: '<div class="as-strong" style="background: #ecf0f1; padding: 10px 6px; color: #000;">Processing..</div>',
            css: {
              border: 'none',
              backgroundColor: 'none'
            },
            overlayCSS: {
              backgroundColor: '#eeeeee',
              opacity: '0.5',
              cursor: 'wait'
            }
          });
        }
      }).done(function(data) {
        // Unblock
        formID.unblock();

        // Notification
        toastr[data.code](data.response);

        // Remove input class
        $('input, textarea, select').removeClass('changed-input');

        // For email tab
        if (data.data) {
          var html;

          html = '<select name="' + ccsmm_admin_l10n.prefix + 'list" id="' + ccsmm_admin_l10n.prefix + 'list">';

          // Loop over the list
          for (var key in data.data) {
            if (formData.get(ccsmm_admin_l10n.prefix + 'list') === key) {
              html += '<option value="' + key + '" selected="selected">' + data.data[key] + '</option>';
            } else {
              html += '<option value="' + key + '">' + data.data[key] + '</option>';
            }
          }

          html += '</select>';
          html += '&nbsp; <button type="button" id="' + ccsmm_admin_l10n.prefix + 'refresh' + '" class="as-btn as-small">' + ccsmm_admin_l10n.refresh_text + '</button>';
          html += '<p class="as-form-help-block">' + ccsmm_admin_l10n.list_text + '</p>';

          // Add the select box to the page
          $('.as-ajax-response').html(html);
        }

        // Hide the checkbox and show the default message if API key is empty
        if (!formData.get(ccsmm_admin_l10n.prefix + 'api')) {
          var listDiv = $('#' + ccsmm_admin_l10n.prefix + 'list');

          if (listDiv.length > 0) {
            listDiv.hide();
          }

          // Show or replace the default message
          $('.as-ajax-response').html('<p class="as-form-help-block">' + ccsmm_admin_l10n.no_api_text + '</p>');
        }
      });
    });


    // Refresh email list
    $(document).on('click', '#' + ccsmm_admin_l10n.prefix + 'refresh', function (e) {
      e.preventDefault();

      // Parent identifier
      var parentDiv = $('.as-ajax-response');

      // AJAX
      $.ajax( {
        type: 'POST',
        url: ajaxurl,
        data: {
          action: ccsmm_admin_l10n.prefix + 'refresh',
          _nonce: ccsmm_admin_l10n.nonce
        },
        beforeSend: function() {
          parentDiv.block({
            message: '<div class="as-strong" style="background: #ecf0f1; padding: 10px 6px; color: #000;">Processing..</div>',
            css: {
              border: 'none',
              backgroundColor: 'none'
            },
            overlayCSS: {
              backgroundColor: '#eeeeee',
              opacity: '0.5',
              cursor: 'wait'
            }
          });
        }
      }).done(function(data) {
        // Unblock
        parentDiv.unblock();

        // Notification
        toastr[data.code](data.response);

        // For email tab
        if (data.data) {
          var html;

          html = '<select name="' + ccsmm_admin_l10n.prefix + 'list" id="' + ccsmm_admin_l10n.prefix + 'list">';

          // Loop over the list
          for (var key in data.data) {
            html += '<option value="' + key + '">' + data.data[key] + '</option>';
          }

          html += '</select>';
          html += '&nbsp; <button type="button" id="' + ccsmm_admin_l10n.prefix + 'refresh' + '" class="as-btn as-small">' + ccsmm_admin_l10n.refresh_text + '</button>';
          html += '<p class="as-form-help-block">' + ccsmm_admin_l10n.list_text + '</p>';

          // Add the select box to the page
          $('.as-ajax-response').html(html);
        }

        // Hide the checkbox and show the default message if API key is empty
        if (!$('#' + ccsmm_admin_l10n.prefix + 'api').val()) {
          var listDiv = $('#' + ccsmm_admin_l10n.prefix + 'list');

          if (listDiv.length > 0) {
            listDiv.hide();
          }

          // Show or replace the default message
          $('.as-ajax-response').html('<p class="as-form-help-block">' + ccsmm_admin_l10n.no_api_text + '</p>');
        }
      });
    });


    // On form change
    $('form').on('change keyup keydown', 'input, textarea, select', function (e) {
      // Get cookie state
      var $state = Cookies.get(ccsmm_admin_l10n.prefix + 'menu');

      if ($state) {
        if ($state != '#support') {
          $(this).addClass('changed-input');
        }
      } else {
        $(this).addClass('changed-input');
      }
    });

    var $state = Cookies.get(ccsmm_admin_l10n.prefix + 'menu');

    // Check menu position
    if ($state) {
      $('.as-main-menu li a').removeClass('active');
      $('a[href="' + $state + '"]').addClass('active');

      // Add : Button (data-tab)
      $('#' + ccsmm_admin_l10n.prefix + 'submit' ).attr('data-tab', $state);

      // Hacks for support and about tabs
      hacks($state);

      // Load
      $($state).fadeIn();
    } else {
      $('.as-main-menu li:first a').addClass('active');
      $('.as-tile:first').fadeIn();

      // Add options (data-tab)
      $('#' + ccsmm_admin_l10n.prefix + 'submit').attr('data-tab', '#basic');
    }


    // Menu
    $('.as-main-menu li a').click(function (e) {
      e.preventDefault();

      // Remove cookies
      Cookies.remove(ccsmm_admin_l10n.prefix + 'menu', {path: '/'});

      var $selector 		= $(this);
      var $tab      		= $selector.attr('href');

      if ($('.changed-input').length) {
        toastr.error('You haven\'t saved your changes.');
      } else {
        // Change menu selection
        $('.as-main-menu li a').removeClass('active');
        $selector.addClass('active');

        // Hide tabs
        $('.as-tile').hide();

        // Load selected tab
        $($tab).fadeIn();

        // Set cookie
        Cookies.set(ccsmm_admin_l10n.prefix + 'menu', $tab, {path: '/'});

        // State button (add)
        $('#' + ccsmm_admin_l10n.prefix + 'submit').attr('data-tab', $tab);

        // Hacks for support and about tabs
        hacks($tab)
      }
    });


    // Mobile navigation
    $('.as-mobile-menu a').click(function () {
      $('.as-main-menu').slideToggle();
    });
  });
})(jQuery);
